import { PieceColor } from '../../domain/piece'
import './GameVS.css'

export default function GameVS(
  props: {
    local_username: string,
    opponent_username: string,
    opponent_pieces: PieceColor
  }) {
  return (
    <div className="game-vs">
      <div className="game-vs-p1">{props.local_username}</div>

      <div className="game-vs-vs">VS</div>

      <div className="game-vs-p1">{props.opponent_username}</div>
    </div>
  )
}
